(window.webpackJsonp=window.webpackJsonp||[]).push([[13],{105:function(e){e.exports=JSON.parse('{"metadata":{"timed":false,"story ID":"543eb3ae-044e-49bc-b89a-916065a4555b","title":{"_default":"AAHP_353_Jackson_Ryan_Hills_2-26-2008"},"media":{"audio":"","video":""},"languages":[],"date_created":"","date_uploaded":"10/8/2025","source":{"_default":""},"description":"","genre":"","author":"","glosser":"","speakers":[],"xml_file_name":"AAHP_353_Jackson_Ryan_Hills_2-26-2008.eaf","source_filetype":"ELAN","tier IDs":{"Speaker 0":{"subdivided":false},"Speaker 1":{"subdivided":false},"Speaker 2":{"subdivided":false},"Speaker 3":{"subdivided":false}},"speaker IDs":{"S1":{"tier":"Speaker 0"},"S2":{"tier":"Speaker 1"},"S3":{"tier":"Speaker 2"},"S4":{"tier":"Speaker 3"}}},"sentences":[{"speaker":"S1","tier":"Speaker 0","start_time_ms":0,"end_time_ms":50000,"num_slots":1,"text":"Start with just having you tell a little bit about yourself, and then I\'ll go in and start asking you questions. It\'ll be, we\'ll be filming for about 20 minutes, and it\'s a shared dialogue of your different experiences. So we do have folks that haven\'t come to the vein, but have had either siblings or have some tie to Mr. McBain or just ties to the community. Um, one of the things that we wanted to do was to make sure that we have the history of how this school started, and it had to start out of the schools before McBain was actually even built. So the Douglas and the a CT, um, ideas came about as a result of that. But as you look around the room, this is our, our designated area for now of all of the memorabilia of the classes of Ma Bain High School.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":50000,"end_time_ms":130000,"num_slots":1,"text":"Now the MABA High School is MABA Middle School. One of the things I wanted our children to do was to understand the history behind this school, and this is about a year and a half of work where the different classes have come in and gotten samples for this room. So when the kids come through, they can look at the rich legacy of Amma Bain High School and understand that, um, so high schools, the years, the graduating classes have samples from their high school years. And I\'m sure that today we\'ll talk about some of those experiences that you bring to the documentary as well. So you are making history today, and thank you. You, you\'re making history today. We will. Um, and we\'re rolling. So whenever you want to start. Okay. We will, um, have a copy of the tape for you at the end of March. Once we edit out, what we\'ll do is we\'re filming today and there\'s segments that we\'ll keep in segments because we are interviewing so many different people. Your perspective is what we\'re looking for. So if I don\'t get to all the questions, don\'t worry about it. If I only get to a few, I just wanna know what your experiences were. Okay. We\'ll start on this end and then get around to Mr. Hill and just, just ask you to tell us a little bit about you and who you are. Okay. We\'ll start with you.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":130000,"end_time_ms":187000,"num_slots":1,"text":"Well, I am Jeanette Gainey Jackson, and, uh, I went to school in the country, a little place called Gordon. And, uh, after there, I, uh, left there and went to, um, and went to school there for a year. I came back here and my father, uh, it was a few bus from the country that was coming to, uh, <inaudible>. So my father, uh, drove his station wagon and, uh, I being, um, the only person that could drive, I later drove his station wagon for a while and my father and the principal and a few of the neighbors and members from the country got together because we had a larger group come into school. So they needed a bus. And","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":187000,"end_time_ms":188000,"num_slots":1,"text":"You, you attended","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":188000,"end_time_ms":195000,"num_slots":1,"text":"A-C-T-I-I attended a CT. Okay. And then, um, during that time I started, I was the bus driver.","dependents":[]},{"speaker":"S3","tier":"Speaker 2","start_time_ms":195000,"end_time_ms":196000,"num_slots":1,"text":"Oh.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":196000,"end_time_ms":251000,"num_slots":1,"text":"So I drove the bus for two terms here. And, um, we, I, I think school started approximately eight 30 in the morning. I don\'t remember how many children we had, but it was a nice group. Mm-hmm <affirmative>. And I had a very good experience. IACP and I, uh, really remember, you know, my, my home economics teaching Mrs. Evans, which was a very nice and gentle person, and I had a good rapport with her. So, um, and the school in general, and Professor <inaudible>, and of course his wife, Ms. Ve, she was a math teacher and eighth grade one at that. So, um, I have a very good experience here.","dependents":[]},{"speaker":"S3","tier":"Speaker 2","start_time_ms":251000,"end_time_ms":294000,"num_slots":1,"text":"Thank you. Having with, were Ryan and I live in High Spring and the mother four, and I\'m proud to say I\'m a member of Douglas High School in High Spring. As a matter of fact, the last graduating class of 1956, we had a very good year. Mr. <inaudible>, our principal, we had beautiful teachers and they, they can say which one were my favorite, all of them my favorite because they taught us, and we can say read and write in arithmetic, but also how to get along with wasn\'t no <inaudible> eyes. Y\'all got along","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":294000,"end_time_ms":301000,"num_slots":1,"text":"And Mr. Welch was also, he also was a, a principal at, um, at the Bay. They go down the","dependents":[]},{"speaker":"S3","tier":"Speaker 2","start_time_ms":301000,"end_time_ms":344000,"num_slots":1,"text":"Line. Well, see, I never came up him. Well, I was the last graduating class, and then I got married and moved away. I see. Okay. Okay. So I went there. Well, when I was in eighth grade, I left and went to Georgia. But I came back my last year in 55 when I finished school in 56. And I lived with my aunt who was a school teacher at that time. S mm-hmm <affirmative>. Well, you know, you know her. We had to be on our piece. She didn\'t tolerate no foolishness. And of course <inaudible>, which our park is named dedicated after her. Okay.","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":344000,"end_time_ms":433000,"num_slots":1,"text":"My name\'s Owen Hill. I was born Bridge and I walked away for if he, if you were born to, if you were born here, you never say a lot. Like people say everybody was born here said, watch away. That\'s what they tell us. <laugh>. Yeah. That for the outside of the what to do, you can tell the people that were born here, they always say Watch away where they come. We leave that. And I went to school at the a CT, walked every morning and we were there at eight 30 as she said, 8 38 30 sharp prophet, standing on the back step with his, be in his hand and everybody lined up. You remember that? He lined up. Then he would ring once, that means he\'d be quiet. He\'d ring the second time. Then just everybody get, get set to go up the steps. Then he\'d ring the third time everybody walked to. So, but at that was after, after when you would was, I think it was after seventh grade when they lined up on one side that that side. But on the elementary side, we lined up on the other end of the school. We just walked in. Mm-hmm. And, uh, what\'s her name?","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":433000,"end_time_ms":528000,"num_slots":1,"text":"She\'s in a book too. Uh, not I leave, I think about it. And this was my elementary years and I a teacher, I think I had Miss Shane Hall when she became Jamie Norton. Jamie Norton chair. Do you remember Norton? You remember Ms. Moore Lewis is, or my elementary teachers? Those my elementary teachers. And uh, when I came into high school, I think I had Ms. Ship who became Ms. Robert. And, uh, there Miss some, Ms. Shepherd, Ms. Green, uh, military Green, which was James Green was person, he was principal. That highest once that he the right became principal. And then we field came down as that principal. So we had quite a few of them. It was quite a joy. We had football team. We played, I played football too, on football team.","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":528000,"end_time_ms":570000,"num_slots":1,"text":"I wasn\'t so good at basketball. I was tall, but I couldn\'t shoot. Oh, just had to hide. Huh? I had to hide. But I was on the travel team. I made sure I made the travel team because I made sure that I did there. So we had a class, most of the kids dropped out, but when I got my, I think it was about 12 or something like that. And we had Elaine Henry, Charles Henry from High Spring and transported from Douglas, Esther, Esther, Esther Hill, then Esther, her brother, Matt, all those kids from High Spring came.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":570000,"end_time_ms":577000,"num_slots":1,"text":"And that\'s, would, would that have been Mr. Hill then once the school, once Douglas was closed?","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":577000,"end_time_ms":579000,"num_slots":1,"text":"No, this was the day they","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":579000,"end_time_ms":592000,"num_slots":1,"text":"We had, well, a CT was better. We had a better school. <laugh>, we had a better school. So they wanted to be associated","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":592000,"end_time_ms":594000,"num_slots":1,"text":"With So they transferred to a C. Yeah.","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":594000,"end_time_ms":632000,"num_slots":1,"text":"You got it. I see. So they came to lot. Charles Henry used to drive his daddy because they had a little chi. They used to drink all of down here to the school every day. So he ain\'t driving away in my class. Charles graduated the class ahead of him. And we, it was 12 of us, but it was pretty nice. I had a good time at a ct, quiet time, but had, would be there every morning. But he would put the strap on you. He call it Dr. Her,","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":632000,"end_time_ms":637000,"num_slots":1,"text":"Did he call it Dr. Her <laugh>?","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":637000,"end_time_ms":641000,"num_slots":1,"text":"He, we had discipline. It wasn\'t anything. We didn\'t have","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":641000,"end_time_ms":643000,"num_slots":1,"text":"A, and the expectations, he","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":643000,"end_time_ms":650000,"num_slots":1,"text":"Didn\'t have a discipline problem because he would take you out the partner shop and would put that Dr. Hurt all on you.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":650000,"end_time_ms":657000,"num_slots":1,"text":"That\'s the first time I heard it. We\'ve learned so much through this document. Dr. Her all","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":657000,"end_time_ms":663000,"num_slots":1,"text":"Was the Yeah, well he named it Dr. Hood all, he kept it in his pocket at all times.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":663000,"end_time_ms":664000,"num_slots":1,"text":"I see.","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":664000,"end_time_ms":668000,"num_slots":1,"text":"Even so you, he didn\'t care where you would","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":668000,"end_time_ms":669000,"num_slots":1,"text":"Pun","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":669000,"end_time_ms":677000,"num_slots":1,"text":"Even seniors didn\'t made any difference where you are a senior or elementary student, he would put Dr. <inaudible> on you, sir.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":677000,"end_time_ms":680000,"num_slots":1,"text":"Expectations. Yes. And this is Mr. Ma. There","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":680000,"end_time_ms":682000,"num_slots":1,"text":"Was Proma","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":682000,"end_time_ms":684000,"num_slots":1,"text":"And you call him Pro Maba. Yes. We","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":684000,"end_time_ms":688000,"num_slots":1,"text":"Call him Pro. Yeah. We, we call, we call him Luke behind his back.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":688000,"end_time_ms":695000,"num_slots":1,"text":"<laugh>. But Proma, where did you get the prof part from? Did someone just start calling him that?","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":695000,"end_time_ms":697000,"num_slots":1,"text":"Yeah, this doctor called him","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":697000,"end_time_ms":699000,"num_slots":1,"text":"Pro professor. Or","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":699000,"end_time_ms":701000,"num_slots":1,"text":"Call him Professor. They called him Prof.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":701000,"end_time_ms":705000,"num_slots":1,"text":"And it\'s interesting because I\'ve heard people say that all throughout the morning. Uhhuh.","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":705000,"end_time_ms":708000,"num_slots":1,"text":"Okay. You even know Mr. Wel, he\'ll always say pro.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":708000,"end_time_ms":713000,"num_slots":1,"text":"Yes. Mr. Welch will be coming. Uhhuh we\'ll be talking to Mr. Wel on tomorrow. Tomorrow. Yeah.","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":713000,"end_time_ms":719000,"num_slots":1,"text":"He would always say. And and his wife was a pretty good disciplinarian too.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":719000,"end_time_ms":722000,"num_slots":1,"text":"And Miss Ms Ang was a math teacher.","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":722000,"end_time_ms":728000,"num_slots":1,"text":"Yeah. Uh, and she was, she had a coconut in the room. And you get her two math C","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":728000,"end_time_ms":731000,"num_slots":1,"text":"Oh boy. <laugh>.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":731000,"end_time_ms":774000,"num_slots":1,"text":"So tell me what I, what I want to do in just summarizing before we, we end the interviews, is to tell me a little bit about where you are in your lives because of your, your school, because of Douglas, because of a CT and the things that during those times that were instilled in you. And you shared some of that because you talked about discipline mm-hmm <affirmative>. And how important that was and expectations. Mm-hmm <affirmative>. Um, but tell me just in your own personal perspectives as we summarize, what, where are you now? How did that make you and, and bring you where you are now as an adult when you look back in hindsight? Lemme stop, repeat.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":774000,"end_time_ms":806000,"num_slots":1,"text":"Well, in hindsight, first of all, everything started at home. My parents were very strong disciplinary people. And, uh, school carried over. And, uh, when we went to school, there were always respect. And, you know, you respect elders no matter who they were. Mm-hmm <affirmative>. Teachers or whether they were not teachers. And we didn\'t have the problem that people have with children today.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":806000,"end_time_ms":810000,"num_slots":1,"text":"And the value of an education was, was, was that was your job to go to school to","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":810000,"end_time_ms":864000,"num_slots":1,"text":"Do. So, I, uh, I, I graduated in 1946 and, um, I left shortly after graduation, I went to New York and I lived there for, uh, until nine, seven for this year, for almost 51 years. Mm-hmm <affirmative>. And, um, I worked in the board of Ed there as a paraprofessional for 30 years. That\'s where I retired. And, uh, I\'ve had a good year. I got married in 50, and I have four wonderful sons and six grandchildren and one great grand. And I\'ve had a very good life. And it was because of all my education that I, here, my home.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":864000,"end_time_ms":867000,"num_slots":1,"text":"Do you have some things to share with us? Yeah. Did you bring","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":867000,"end_time_ms":876000,"num_slots":1,"text":"Things? Oh, no. It\'s just something that I jo it down and I do have a printout about a CT, how it actually got started.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":876000,"end_time_ms":878000,"num_slots":1,"text":"That\'s a part of the book in","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":878000,"end_time_ms":949000,"num_slots":1,"text":"The history. Yeah. And this man that, uh, his name was mm-hmm <affirmative>. And he had a vision. He could not read nor write, but he had a vision about, you know, building a school in ache. He was a tough guy. He worked very hard. He worked, walked five miles a day, both way going and coming to and from work. And he chipped boxes with the box off the trees and that there were boxes to catch the risen, I think it\'s called raised and whatever. And, um, he, um, was injured and he had to go to a hospital in Atlanta. And so while he was there, he asked his nurse, which was a white nurse about schools, he was able to see certain schools, and he wanted to know how to get started because he had that vision, even though he couldn\'t read or write to build a school.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":949000,"end_time_ms":1043000,"num_slots":1,"text":"So she gave him some pointers on fundraisers and Rosen Wall, I think it was, was one of them. And she told him how he could, uh, you know, get some help with them. So anyway, being in the hospital for a long period of time, he was transferred to Philadelphia. And in Philadelphia, he\'s had to stay there. And he asked his nurse about the same, his vision about building the school, and she told him about a fundraiser. I think he was something Slater. Mm-hmm <affirmative>. And told him how to go about it. So anyway, when he got back to, uh, <inaudible>, he, uh, brought it up among the neighbors and they told him, uh, uh, you know how to go about it. And so he, uh, went down to the school board and approached them and they told him that he could, uh, they, the blacks had a two room school, which we all had when we started with just two rooms. And he, um, he was able to, they told him that he, you know, could sell that building and use the money to buy some land, you know, for a school. And told him how to go about it and told him how much he could need and all of that. I see that. Yes. All of that is another","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1043000,"end_time_ms":1045000,"num_slots":1,"text":"And it\'s a very interesting,","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1045000,"end_time_ms":1049000,"num_slots":1,"text":"And it opened in 1922, September. That\'s","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1049000,"end_time_ms":1050000,"num_slots":1,"text":"September.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1050000,"end_time_ms":1053000,"num_slots":1,"text":"Day. September of 1922.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1053000,"end_time_ms":1058000,"num_slots":1,"text":"I think he told me it was September 23rd, 1922. Uhhuh.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1058000,"end_time_ms":1063000,"num_slots":1,"text":"Remember the first day of Really? Yes, he did. He did.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1063000,"end_time_ms":1068000,"num_slots":1,"text":"But all that article is in that letter. Okay. Well, you shared this with","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1068000,"end_time_ms":1070000,"num_slots":1,"text":"Us, and so we can get a copy. Mm-hmm","dependents":[]},{"speaker":"S3","tier":"Speaker 2","start_time_ms":1070000,"end_time_ms":1072000,"num_slots":1,"text":"<affirmative>. You may have that. Thank you.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1072000,"end_time_ms":1074000,"num_slots":1,"text":"And in summarizing,","dependents":[]},{"speaker":"S3","tier":"Speaker 2","start_time_ms":1074000,"end_time_ms":1154000,"num_slots":1,"text":"In summarizing, my education has done, as I folks said, mostly we talked about, I was to read and write. And we say at that time, we had no time, maybe one, no lamps, no new books. We got what was left over and we took them and we took <inaudible>. We would go through the books. And if we found the king book, that was just so amazing because most of \'em had pictures. The pages torn out, the words were built. But they keep us from getting our education because we were taught to keep, learn and be. And another thing about that school, our school was taught how to and how to sit your school in wasn\'t no building our, we always been a rock, but when the girls, they knew how to conduct themselves, Ms. Taylor would always tell us and my aunt, like these little t straps that they were, that was our girls, were not allowed to see hair come in the arms. You have staff that you had to live by boys you had to have on suspenders or a rope or something to hold those pants up. They wasn\'t below the neighbor. And that\'s what we need to bring back in","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1154000,"end_time_ms":1157000,"num_slots":1,"text":"Our students. So just those standards, standards, expectations.","dependents":[]},{"speaker":"S3","tier":"Speaker 2","start_time_ms":1157000,"end_time_ms":1197000,"num_slots":1,"text":"Yeah. We had standards that we had to live by. And then they started a school, we started at home and parents, a lot of them. And the old Proverbs said, it take the whole village to arrange one child. It still goes to that. But the teachers now, they can\'t do it because of different things that have happened. If it\'s nighttime, you cannot expect those kids, you cannot say harsh words to \'em, because the kids run back to their parents and it is a different thing altogether. Then the next thing you know, here come one up. Blowing up with the teachers. They don\'t send the children down to my idea to get educated. They want to be, why don\'t they come out here and sit with them sometime and met them? See how these teachers,","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1197000,"end_time_ms":1214000,"num_slots":1,"text":"And the expectations then was you knew what you had to do. This is what you came to school to do, to be obedient. And then at home you did not disrespect home by coming to school and acting any kind of way. That\'s right. What was expected of you. Mm-hmm <affirmative>. Well, Mr.","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":1214000,"end_time_ms":1288000,"num_slots":1,"text":"The same goes is it was, we were taught respect for know if they were our elder, they were Might as well been your parents, because That\'s right. If you did something anyway, when you got home, your parents knew it anyway. Mm-hmm <affirmative>. And you get a whipping because, and you couldn\'t say, I didn\'t do it when you crossed so and so alive, so you get another whisper. That\'s right. Mm-hmm <affirmative>. So therefore, and prosper. He was a stick, he was a stick disciplinarian. He didn\'t care who you were, you was going to get a whip if he didn\'t do what he said there. But I, there was something about proper that stuck with me. When you start something, don\'t stop, continue until is complete. Mm-hmm <affirmative>. And so I think, uh, even he went to North Carolina a t and that\'s the reason I wanted to go to North Carolina. And I went to North Carolina a t and I graduated from North Carolina T And when he found out when I was going to school, he found out I was going to a t He, he was boy like, okay, <laugh>.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1288000,"end_time_ms":1300000,"num_slots":1,"text":"Tell us a little bit about, um, Mr. Levi. You shared something with us earlier before we started recording about his feeling about Labi. Well, in, in his older, you know, in his older years,","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":1300000,"end_time_ms":1316000,"num_slots":1,"text":"In his older years, he, he retired. That\'s what, when he retired, Mr. Whitfield taken over for him. He was, Mr. Whitfield was, uh, assistant principal, but after Prof got so sick that he would stay home.","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":1316000,"end_time_ms":1326000,"num_slots":1,"text":"Whitfield Yeah. Became principal, but Prof, and they were building this place here, but Prof never, but he never did see it.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1326000,"end_time_ms":1329000,"num_slots":1,"text":"And he never saw, he never saw Main high school? No. He never saw,","dependents":[]},{"speaker":"S4","tier":"Speaker 3","start_time_ms":1329000,"end_time_ms":1367000,"num_slots":1,"text":"He never saw it. And he never, he said he didn\'t want to see it. So I, first time and his wife tried to bring him up. Every, now many people tried to bring him up here, but he wouldn\'t, he wouldn\'t, he wouldn\'t see it. He said he just wanted to remember, just want to know that something had been done. And <inaudible> told that they wouldn\'t remember him. But other than that, he said he didn\'t have no period to see it. And he died and not see it. Really? He carried him back to North Carolina. He never knew. He didn\'t even want to see a picture of it. So. And the literacy been on. Oh, yes.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1367000,"end_time_ms":1370000,"num_slots":1,"text":"Did. Thank you everyone for sharing with us today.","dependents":[]}]}')}}]);
